const ajiData = [
  {
    id: "audio",
    data: "data:audio/mpeg;base64,",
  },
];

let count = 0;

async function setup() {
  await ajiAddAudio("audio", "audio");
}

async function loop() {
  ajiSetFillColor("#006064");
  ajiFillRect(0, 0, AJIPACK_WIDTH, AJIPACK_HEIGHT);
  ajiSetFillColor("#fff");
  ajiSetFont("24px sans-serif");
  if (count == 0) {
    ajiDrawAlignText("クリック/タッチで再生", 0, 180, AJIPACK_WIDTH, "center");
  } else {
    ajiDrawAlignText("クリック/タッチで停止", 0, 180, AJIPACK_WIDTH, "center");
  }
  if (ajiClick() == true) {
    if (count == 0) {
      ajiPlayAudio("audio");
    } else {
      ajiStopAudio("audio");
    }
    count++;
    if (count >= 2) {
      count = 0;
    }
  }
}
